INSERT INTO `wp_postmeta` VALUES (357,68,'main_body_content','<strong>Biology Program</strong>is an immersive and educational event designed to spark curiosity and deepen understanding of life sciences. Taking place on<strong>November 25, 2023</strong>, from<strong>10:00 AM to 1:00 PM</strong>in the<strong>Science Lab Building</strong>, the program features hands-on experiments, interactive workshops, and expert talks on topics like genetics, ecology, and human anatomy. Perfect for students and enthusiasts, this event encourages exploration and discovery in the fascinating world of biology. Join us to learn, experiment, and connect with fellow science lovers!\r\nThe biology program works closely with the math program.');
