INSERT INTO `wp_posts` VALUES (62,1,'2025-02-13 10:45:27','2025-02-13 10:45:27','<!-- wp:paragraph -->\n<p>Winter Study Night is a cozy, focused event where students gather to prepare for exams during the chilly winter months. Held on<strong>April 15, 202</strong>5, from<strong>6:00 PM to 10:00 PM</strong>in the<strong>Campus Library Lounge</strong>, it offers a quiet atmosphere for individual study, group discussions, and collaborative learning. Hot beverages like cocoa, coffee, and snacks keep energy levels high. The event includes study resources, tutoring stations, and motivational breaks to help participants stay productive. Its a perfect blend of academic focus and winter comfort, fostering learning and camaraderie.</p>\n<!-- /wp:paragraph -->','Winter Study Night','Winter Study Night is a cozy, focused event where students gather to prepare for exams during the chilly winter months.','publish','closed','closed','','winter-study-night','','','2025-02-13 10:45:27','2025-02-13 10:45:27','',0,'http://fictional-university.local/?post_type=event&#038;p=62',0,'event','',0);
