INSERT INTO `wp_posts` VALUES (69,1,'2025-02-13 12:24:23','2025-02-13 12:24:23','<!-- wp:paragraph -->\n<p><strong>English Program</strong>is an enriching event aimed at enhancing language skills and fostering a love for literature and communication. Held on<strong>November 28, 2023</strong>, from<strong>2:00 PM to 4:30 PM</strong>in the<strong>School Library</strong>, the program includes creative writing workshops, poetry readings, and interactive sessions on grammar and storytelling. Whether you\'re a budding writer or looking to improve your language proficiency, this event offers a welcoming space to learn, share, and grow. Join us to explore the power of words and express yourself confidently!</p>\n<!-- /wp:paragraph -->','English','','publish','closed','closed','','english','','','2025-02-13 12:24:23','2025-02-13 12:24:23','',0,'http://fictional-university.local/?post_type=program&#038;p=69',0,'program','',0);
INSERT INTO `wp_posts` VALUES (70,1,'2025-02-13 13:03:42','2025-02-13 13:03:42','<!-- wp:paragraph -->\n<p><strong>The Science of Cats</strong>is a fascinating event exploring the biology, behavior, and unique traits of our feline friends. Held on<strong>May 5, 202</strong>5, from<strong>4:00 PM to 6:00 PM</strong>in the<strong>Community Science Center</strong>, the program features expert talks, interactive demonstrations, and fun activities like cat anatomy models and behavior analysis. Perfect for cat lovers and science enthusiasts alike, this event offers a purr-fect blend of education and entertainment. Join us to uncover the mysteries behind these captivating creatures!</p>\n<!-- /wp:paragraph -->','The Science of Cat','','publish','closed','closed','','the-science-of-cat','','','2025-02-13 13:12:26','2025-02-13 13:12:26','',0,'http://fictional-university.local/?post_type=event&#038;p=70',0,'event','',0);
