INSERT INTO `wp_posts` VALUES (73,1,'2025-02-18 06:27:04','2025-02-18 06:27:04','<!-- wp:paragraph -->\n<p>Dr. Meowalot is the purr-fessional feline therapist you never knew you needed! With a PhD in Purr-sonality Studies and a lifetime of expertise in nap optimization, Dr. Meowalot specializes in curing the human condition with gentle headbutts, soothing purrs, and the occasional judgmental stare. Whether you\'re stressed, lonely, or just need a furry confidant, Dr. Meowalot is here to listen (or nap through it). Book your session today and let the healing beginmeow!  #CatTherapist #PawsitiveVibes #MeowalotMendsHearts</p>\n<!-- /wp:paragraph -->','Dr. Meowalot &lt;script>alert(\"hello\");&lt;/script>','','publish','closed','closed','','dr-meowalot','','','2025-04-17 04:43:02','2025-04-17 04:43:02','',0,'http://fictional-university.local/?post_type=professor&#038;p=73',0,'professor','',0);
INSERT INTO `wp_posts` VALUES (74,1,'2025-02-18 06:28:53','2025-02-18 06:28:53','<!-- wp:paragraph -->\n<p>Dr. Barksalot is the ultimate canine counselor, here to wag away your worries! With a tail-wagging PhD in Bark-logy and a knack for sniffing out stress, Dr. Barksalot offers expert advice through enthusiastic barks, slobbery kisses, and endless fetch sessions. Whether you need a pep talk, a playdate, or just a loyal ear to listen, Dr. Barksalot is on the case! Book your appointment now and let the pawsitive energy flow!  #BarkTherapy #WaggingWellness #BarksalotCares. I love biology.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:ourplugin/seeking-attention {\"skyColor\":\"blue\",\"grassColor\":\"yellow\"} /-->\n\n<!-- wp:ourplugin/featured-professor {\"profId\":\"73\"} /-->\n\n<!-- wp:ourplugin/a-multiple-choice {\"question\":\"What is the color of mango?\",\"answers\":[\"purple\",\"green\",\"red\",\"yellow\"],\"correctAnswer\":3,\"bgColor\":\"#9be0ea\",\"theAlignment\":\"center\"} /-->\n\n<!-- wp:ourplugin/a-multiple-choice {\"question\":\"bark a lot?\",\"answers\":[\"fish\",\"dog\",\"cat\"],\"correctAnswer\":1,\"bgColor\":\"#edb6b6\"} /-->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Dr. Basrksalot','','publish','closed','closed','','dr-basrksalot','','','2025-04-16 12:22:35','2025-04-16 12:22:35','',0,'http://fictional-university.local/?post_type=professor&#038;p=74',0,'professor','',0);
