INSERT INTO `wp_posts` VALUES (101,1,'2025-02-26 12:39:41','2025-02-26 12:39:41','<!-- wp:paragraph -->\n<p>Biology is seriously cool because its like uncovering the ultimate secrets of life! From the tiniest cells working like mini factories to the complex ecosystems where every organism plays a role, its mind-blowing. Think about it: your DNA is basically a unique code that makes you&nbsp;<em>you</em>, and plants are out here turning sunlight into food like its no big deal. Plus, biology helps us understand everything from curing diseases to saving endangered species. Its like the ultimate puzzle, and every discovery feels like leveling up in the game of science. Who wouldnt think thats awesome?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:ourplugin/featured-professor {\"profId\":\"79\"} /-->\n\n<!-- wp:ourplugin/featured-professor {\"profId\":\"74\"} /-->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Biology is Cool','','publish','open','open','','bilology-is-cool','','','2025-04-22 08:45:32','2025-04-22 08:45:32','',0,'http://fictional-university.local/?p=101',0,'post','',0);
